/**
 * @param {string} s
 * @return {number}
 */
var numSub = function (s) {
  const mod = Math.pow(10, 9) + 7;
  let arr = [];
  let count = 0;
  for (let i = 0; i < s.length; i++) {
    const element = s[i];
    if (element === '1') {
      count++;
    } else {
      if (count > 0) {
        arr.push(count);
        count = 0;
      }
    }
  }
  if (count > 0) {
    arr.push(count);
  }
  let ans = 0;
  for (let i = 0; i < arr.length; i++) {
    const element = arr[i];
    ans += ((1 + element) * element) / 2;
    ans = ans % mod;
  }
  return ans;
};

